import logo from './logo192.png';

function Header() {
  return(
    <header>
      <nav>
        <img src={logo} width="40px" />
        <ul>
          <li><a href="#">Pricing</a></li>
          <li><a href="#">About</a></li>
          <li><a href="#">Contact</a></li>
        </ul>
      </nav>
    </header>
  )
}

function Page() {
  return (
    <div className="Page">
      <h1 className="header">Reasons I'm excited to learn React</h1>
      <ol>
        <li>It's a popular library, so I'll be able to fit in with the cool kids!</li>
        <li>I'm more likely to get a job as a developer if I know React</li>
      </ol>
    </div>
  )
}

function Footer() {
  return(
    <footer>
      <small>&copy; 2023 Md Maksudur Rahman Development. All rights reserved.</small>
    </footer>
  )
}

function App() {
  return (
    <div className="App">
        <Header />
        <Page />
        <Footer />
        {/* <h1 className="header">Fun facts about React</h1>
        <ul>
            <li>Was first released in 2013</li>
            <li>Was orginally created by Jordan Walke</li>
            <li>Has well over 100k stars on Github</li>
            <li>Is maintained by Facebook</li>
            <li>Powers thousands of enterprise apps, including mobile apps</li>
        </ul> */}
    </div>
  )
}

export default App;
